#include <fstream>
#include <cstdio>
#include <cmath>

using namespace std;

const char* answer = "";

int main() {
	ifstream reader("planaritycheck.in");
	ofstream writer("planaritycheck.out");
	int N;
	string s;
	reader >> N;
	getline(reader, s);
	for (int i = 0; i < N; i++) {
		string graph;
		getline (reader, graph);
		int verticesCount, edgesCount = graph.size();
		verticesCount = (1 + sqrt(1 + 8 * edgesCount)) / 2;
		if (verticesCount <= 4) {
			writer << "YES" << endl;
		}
		else if (verticesCount == 5) {
			if (graph == "1111111111") {
				writer << "NO" << endl;
			}
			else {
				writer << "YES" << endl;
			}
		}
		else {
			int index = 0;
			for (int j = 0; j < edgesCount; j++) {
				index += (graph[edgesCount - j - 1] - '0') * (1 << j);
			}
			writer << (answer[index] == '1' ? "YES" : "NO") << endl;
		}
	}
	return 0;
}